import React from "react";
import "./App.css";
import { Routes, Route } from "react-router-dom";
import { Home } from "./pages/Home";
import { NavBar } from "./components/Navbar";

function App() {
  return (
    <Stack direction={"row"} className="App">
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
    </Stack>
  );
}

export default App;
